import React from "react";
import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
  { eid: 1, name: "Arjit Concert" },
  { eid: 2, name: "Personality Developement Workshop" },
];

const EventsPage = () => {
  return (
    <>
      <h1>EventsPage</h1>
      {DUMMY_EVENTS.map((item) => (
        <li key={item.eid}>
          <Link to={item.eid} relative="path">
            {item.name}
          </Link>
        </li>
      ))}
    </>
  );
};

export default EventsPage;
